export async function isValidImageOrPdfUrl(url) {
    try {
        const urlObj = new URL(url);
        const validExtensions = /\.(jpg|jpeg|png|gif|pdf)$/i;
        return validExtensions.test(urlObj.pathname);
    } catch (error) {
        console.error('Invalid URL:', error);
        return false;
    }
}

