export async function revisarpalabramatch(palabra, inicio, fin) {
  var salida = "";
  try {
    var regExpStr = new RegExp(inicio + " .*? " + fin, "g");
    var registros = (palabra.toUpperCase().match(regExpStr));
    //    var registros = (palabra.toUpperCase().match(/CODIGO PEDIDO .*? ES CORRECTO!/g));
    salida = registros[0].replace(inicio, "").replace(fin, "").replaceAll(" ", "");
    //    console.log("SALIDDDDD"+salida);
  } catch (e) {
    //    console.log(e);
  }
  return salida;
}

export async function limpiarNumero(numero, codpais) {
  if (numero) {
    let numeroLimpio = numero.replace(/[^\d]/g, '');
    if (numeroLimpio.startsWith('9') && numeroLimpio.length === 8) {
      numeroLimpio = codpais + '9' + numeroLimpio;
    }
    if (!numeroLimpio.startsWith(codpais)) {
      numeroLimpio = codpais + numeroLimpio;
    }
    return numeroLimpio;
  } else {
    return "";
  }
}

export async function obtenerevento(numero_enviar, mensaje_buscar, tipo_validacion, existe_conversacion, sheet_conversacion, payload_) {
//  console.log("obtenerevento" + numero_enviar + "::::" + mensaje_buscar+":::::::::::"+tipo_validacion);
  var conversacion_ingresado = {};
  var evento_retorna_arreglo_menu = [];
  try {
    //          console.log(numero_enviar, mensaje_buscar, tipo_validacion);
    var filtroconversacion = [];
    if (existe_conversacion) {
      filtroconversacion = JSON.parse(existe_conversacion);
    }
    // RECORREMOS LAS CONVERCACION PARA CONOCER EL EVENTO
    //console.log("filtroconversacion", JSON.stringify(filtroconversacion));
    var evento = sheet_conversacion.find((item) => ((item[1] + "").toUpperCase()).split(";").includes(mensaje_buscar.toUpperCase()));
    var evento_error = sheet_conversacion.find((item) => item[0] === "Error");
    var evento_start = sheet_conversacion.find((item) => item[0] === "Start");
    var id_fila = -1;
    //validamos horarios
    if (payload_.horainicio && payload_.horafin && payload_.horaactual) {
      var horaactual = parseInt("" + payload_.horaactual);
      //            console.log("horaactual" + horaactual);
      //            console.log("payloadddddd............" + JSON.stringify(payload_));
      if (numero_enviar != "51986321853" && payload_.horainicio && payload_.horafin && (horaactual < parseInt(payload_.horainicio) || horaactual > parseInt(payload_.horafin))) {
        var evento_horario = sheet_conversacion.find((item) => item[0] === "Error_End_Horario");
        //                console.log("evento_horario", evento_horario);
        return { conversaciones: filtroconversacion, status: "0", tipo: "mensaje", numero: numero_enviar, mensaje_entrada: mensaje_buscar, evento: evento_horario[0], retornar: evento_horario[2], mensaje_salida: evento_horario[4], mensaje_salida_2: evento_horario[5], validacion_mensaje: evento_horario[3], id_fila: id_fila };
      }
    }
    //OBTENER LA POSICION
    var evento_start_inicio = filtroconversacion.find((item) => item.evento === "Start");
    if (evento_start_inicio) {
      id_fila = evento_start_inicio.id_fila;
    }
    if (evento === undefined) {
      evento = evento_error;
      if (filtroconversacion.length > 0) {
        var evento_retorno = filtroconversacion[filtroconversacion.length - 1].retornar;
        var evento_retornar = sheet_conversacion.find((item) => evento_retorno != "" && item[0] === evento_retorno);
        if (evento_retornar !== undefined) {
          evento = evento_retornar;
        } else {
          // CASO SEAN ARREGLOS ::
          evento_retorna_arreglo_menu = evento_retorno.split(";");
          if (evento_retorna_arreglo_menu.length > 1) {
            for (let jl = 0; jl < evento_retorna_arreglo_menu.length; jl++) {
              var evento_msj = evento_retorna_arreglo_menu[jl].split(",");
              if ((evento_msj[1] + "").toUpperCase() === ("" + mensaje_buscar).toUpperCase()) {
                var evento_retornar_menu = sheet_conversacion.find((item) => item[0] === evento_msj[0]);
                if (evento_retornar_menu !== undefined) {
                  evento = evento_retornar_menu;
                  break;
                }
              }
            }
          }
        }
      }
      //console.log("evenenn 1", JSON.stringify(evento), evento_retorna_arreglo_menu.length, JSON.stringify(filtroconversacion));
      //VALIDACION DE TIPO DE MENSAJES para solo botones
      try {
        if (evento[0] == "Error" && evento_retorna_arreglo_menu.length > 1 && (filtroconversacion[filtroconversacion.length - 1].mensaje_salida.includes("<boton>") || (filtroconversacion[filtroconversacion.length - 1].mensaje_salida_2 && filtroconversacion[filtroconversacion.length - 1].mensaje_salida_2.includes("<boton>")))) {
          filtroconversacion[filtroconversacion.length - 1].status = "3";//ERROR DE TIPO DATO
          return filtroconversacion[filtroconversacion.length - 1];
        }
      } catch (e1) {
      }
      //FIN VALIDACION DE TIPO DE MENSAJES  para solo botones

      if (evento[0] == "Error" && evento_start && evento_start[1].includes("%%%")) {
        // CONVERSACION NUMERO CELULAR
        evento = evento_start;
        if (filtroconversacion.length == 0) {
          evento = evento_start;
        }
        if (filtroconversacion.length == 1 && filtroconversacion[0].evento.includes("Close")) {
          evento = evento_start;
        }
      }
    }
    //VALIDACION DE TIPO DE MENSAJES para continuar al siguiente eventos
    if (!(evento[0] == "Start" || evento[0] == "Error" || evento[0] == "End_Pedido" || evento[0] == "End_Hablar_humano") && filtroconversacion.length > 0 && filtroconversacion[filtroconversacion.length - 1].validacion_mensaje) {
      if (tipo_validacion == "TEXTO" && filtroconversacion[filtroconversacion.length - 1].validacion_mensaje == "TEXTO_TOTAL") {
        if (!mensaje_buscar.includes("TOTAL")) {
          filtroconversacion[filtroconversacion.length - 1].status = "3";//ERROR DE TIPO DATO
        }
      } else if (tipo_validacion == "TEXTO" && filtroconversacion[filtroconversacion.length - 1].validacion_mensaje == "TEXTO_REFERENCIA") {
        if ((mensaje_buscar + "").length < 35) {
          filtroconversacion[filtroconversacion.length - 1].status = "4";//ERROR DE TIPO DATO
        }
      } else if (tipo_validacion == "TEXTO" && filtroconversacion[filtroconversacion.length - 1].validacion_mensaje == "TEXTO_NOMBRE") {
        var datos_n = (mensaje_buscar + "").split(" ");
        if (datos_n.length < 2 || datos_n[0].length < 3) {
          filtroconversacion[filtroconversacion.length - 1].status = "5";//ERROR DE TIPO DATO
        }
      } else if (tipo_validacion == "TEXTO" && filtroconversacion[filtroconversacion.length - 1].validacion_mensaje == "TEXTO_SUCURSAL") {
        var resultado = true;
        if (payload_.sucursales) {
          for (var ii = 0; ii < payload_.sucursales.length; ii++) {
            if ((payload_.sucursales[ii] + "").toUpperCase() != "SUCURSAL") {
              if (payload_.sucursales[ii] == mensaje_buscar) {
                resultado = false;
                break;
              }
            }
          }
        }
        if (resultado) {
          filtroconversacion[filtroconversacion.length - 1].status = "3";//ERROR DE TIPO DATO
        }
      } else if (filtroconversacion[filtroconversacion.length - 1].validacion_mensaje != tipo_validacion) {
        filtroconversacion[filtroconversacion.length - 1].status = "3";//ERROR DE TIPO DATO
      }
      // mennsajes de errror 
      if (filtroconversacion[filtroconversacion.length - 1].status == "3" || filtroconversacion[filtroconversacion.length - 1].status == "4" || filtroconversacion[filtroconversacion.length - 1].status == "5") {
        return filtroconversacion[filtroconversacion.length - 1];
      }
    }
    //FIN VALIDACION DE TIPO DE MENSAJES para continuar al siguiente eventos
    conversacion_ingresado = { conversaciones: filtroconversacion, status: "0", tipo: "mensaje", numero: numero_enviar, mensaje_entrada: mensaje_buscar, evento: evento[0], retornar: evento[2], mensaje_salida: evento[4], mensaje_salida_2: evento[5], validacion_mensaje: evento[3], id_fila: id_fila };
  } catch (e) {
    console.log("DATOS :::: "+e);
    conversacion_ingresado = { status: "-1", message: e.toString() };
  }
  //console.log("obtenerevento" + numero_enviar + "::::" + JSON.stringify(conversacion_ingresado));
  return conversacion_ingresado;
}

export async function url_base64(url) {
  try {
    const response = await axios.get(url, { responseType: 'arraybuffer' });
    const audioBuffer = Buffer.from(response.data, 'binary');
    const audioBase64 = audioBuffer.toString('base64');
    return audioBase64;
  } catch (error) {
    console.error('Error al convertir el audio a base64:', error);
    return "";
  }
}
export async function getbuffer_api(url_, header) {
  var jo = { "status": "-1", "message": "NO OK" };
  try {
    let config_invoce = {
      headers: {
        'accept': 'application/json',
        'content-type': 'application/json'
      }
    };
    if (header && header.length > 0) {
      for (var jj = 0; jj < header.length; jj++) {
        config_invoce.headers[header[jj].id] = header[jj].valor;
      }
    }
    config_invoce.responseType = 'arraybuffer';
      jo = await axios.get(url_, config_invoce).then((res) => {
        var mimetype = res.headers['content-type'];
        if (mimetype.includes(";")) {
          mimetype = mimetype.split(";")[0];
        }
        const buffer = Buffer.from(res.data, 'binary').toString('base64');
        return { status: "0", message: "OK", data: { base: buffer, type: mimetype } };
      }).catch(err => {
        return { status: "1", message: err, data: {} }
      });
  } catch (error) {
    jo = { "status": "-1", "message": "" + error }
  }
  return jo;
}

