  export async function urlencodetojson(encodedString) {
    // Decodificar uri components
    const decodedString = decodeURIComponent(encodedString);
    // Crear un objeto para almacenar el resultado final
    const result = {};
    // Separar los pares 'clave=valor' utilizando '&' como delimitador
    const pairs = decodedString.split('&');
    // Función auxiliar para anidar valores en un objeto dado
    function assignNested(obj, keys, value) {
        let current = obj;
        for (let i = 0; i < keys.length - 1; i++) {
            if (!current[keys[i]]) {
                // Si la clave actual no existe, crear un nuevo objeto
                current[keys[i]] = {};
            }
            current = current[keys[i]];
        }
        current[keys[keys.length - 1]] = value;
    }
    // Iterar sobre cada par 'clave=valor'
    pairs.forEach(pair => {
        // Separar la clave del valor
        const [key, value] = pair.split('=');
        // Dividir la clave en partes en array utilizando los corchetes para denotar niveles anidados
        const keys = key.replace(/\]/g, '').split('[');
        // Asignar el valor anidado en el objeto resultante
        assignNested(result, keys, value);
    });
    return result;
};
  